class Solution:
    def findLongestWord(self, s: str, d: 'List[str]') -> str:
        output = ""
        for word in d:
            if len(word) <= len(s):
                s_list = list(s)
                w_list = list(word)
                while w_list and s_list:
                    if w_list[0] == s_list[0]:
                        w_list.pop(0)
                    s_list.pop(0)
                if w_list == []:
                    if len(word) > len(output):
                        output = word
                    elif len(word) == len(output):
                        output = min(output, word)
        return output


